import { keyframes } from 'styled-components';
export const spin = keyframes `
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(-360deg);
  }
`;
export const spinCW = keyframes `
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(360deg);
  }
`;
